import React, { Component } from 'react'
// import '../assets/css/main.css'
// import '../assets/css/home.css'
// import '../App.css'

import me from '../content/images/common/me2021.jpg'
import cv from '../assets/icons/document-text.svg'
import github from '../assets/icons/github.png'

export default class Home extends Component
{	
  render()
  {
		return (
			// <div class="d-flex align-items-center flex-column justify-content-center h-100">
      <div>
      <img src={me} class="mr-4 rounded-circle" width="250" height="250" alt="Sebastian Rodriguez" />       
      <h1>Sebastian S(amuel) Rodriguez</h1>
      <h4>srodri44 [at] illinois [dot] edu</h4>
      <p>
      <a target="_blank" rel="noreferrer" href="content/docs/cv.pdf"><img src={cv} alt="Download CV" width="32" height="32" title="CV" /></a>
      <a target="_blank" rel="noreferrer" href="https://github.com/srodriguez1850"><img src={github} alt="GitHub" width="32" height="32" title="GitHub" /></a>
      <a target="_blank" rel="noreferrer" href="https://scholar.google.com/citations?user=RdD2ZP8AAAAJ"><img src="https://img.icons8.com/ios/50/000000/google-scholar.png" alt="Google Scholar" width="32" height="32" title="Google Scholar" /></a>
      <a target="_blank" rel="noreferrer" href="https://www.linkedin.com/in/srodriguez1850/"><img src="https://img.icons8.com/ios-filled/50/000000/linkedin.png" alt="LinkedIn" width="32" height="32" title="LinkedIn" /></a>
      <a target="_blank" rel="noreferrer" href="https://www.researchgate.net/profile/Sebastian_Rodriguez75"><img src="https://img.icons8.com/windows/64/000000/researchgate.png" alt="ResearchGate" width="32" height="32" title="ResearchGate" /></a>
      </p>
      <hr />
      <h1><a href="/research">Research</a> | <a href="/portfolio">Portfolio</a></h1>
      </div>
    )
  }
}
